import React, { useState } from 'react';
import axios from 'axios';

const CLASS_LABELS = ["Setosa", "Versicolor", "Virginica"];

const PredictForm = () => {
  const [inputData, setInputData] = useState({
    dense_2_input: [5.1, 3.5, 1.4, 0.2],
  });
  const [response, setResponse] = useState(null);
  const [error, setError] = useState(null);

  const handleSubmit = async (event) => {
  event.preventDefault();
  try {
    const result = await axios.post('http://localhost:8000/predict/iris_model', inputData, {
      headers: {
        'Content-Type': 'application/json',
      },
    });
    console.log("Response data:", result.data); // Yanıtın yapısını kontrol et

    // Yanıtın varlığını kontrol et
    if (result.data && result.data.predicted_class && result.data.probabilities) {
      const predictions = result.data.probabilities;
      const predictedClass = result.data.predicted_class;
      setResponse({ predictedClass, probabilities: predictions });
    } else {
      console.log("Predictions data is not available.");
      setError("Prediction data is not available.");
    }
  } catch (error) {
    console.log("Error details:", error);
    setError(error.response ? error.response.data : 'An error occurred');
  }
};


